class MetavizNodeUberDuck extends MetavizNode {

    /**
     * Constructor
     */

    constructor(args) {
        super(args);

        // Initial size
        if (this.transform.w == 0) this.setSize({width: 128, height: 128});

        // Background image
        const bg = "data:image/png;base64,";

        // Controls
        this.addControls({

            // Bitmap control
            bitmap: new MetavizControlBitmap({
                uri: bg
            }),

            // Chat control
            chat: new MetavizControlUberDuckChat(),

        });

        // Comic dot
        const cmxdot = document.createElement('div');
        cmxdot.classList.add('comic-dot');
        this.element.append(cmxdot);

    }

    /**
     * Init after node is added into DOM tree
     */

    start() {
        this.controls.chat.start();
    }

    /**
     * Export node to different format
     */

    export(format) {

        if (format == 'miniature') {
            return `<div class="miniature metaviz-node-uber-duck" data-id="${this.id}">ðŸ¦†</div>`;
        }

        else if (format == 'image/svg+xml') {
            return ``;
        }

        return super.export(format);
    }

}

class MetavizControlUberDuckChat extends MetavizControl {

    /**
     * Constructor
     */

    constructor() {
        super();

        // Main element
        this.element = document.createElement('div');
        this.element.classList.add('metaviz-control');
        this.element.classList.add('metaviz-control-uber-duck-chat');

        // Mouse wheel scroll
        this.element.addEventListener('wheel', event => {
            if (this.element.scrollHeight > 500) {
                event.stopPropagation();
                this.element.scrollTop += event.deltaY;
            }
        });

        // Composer Bubble
        this.composer = document.createElement('div');
        this.composer.classList.add('bubble');
        this.composer.style.display = 'none';

        // Editable area
        this.editable = document.createElement('div');
        this.editable.setAttribute('contenteditable', 'true');
        this.editable.classList.add('editable');
        this.composer.append(this.editable);

        // Placeholder
        const placeholder = document.createElement('div');
        placeholder.classList.add('placeholder');
        placeholder.innerText = 'Enter the AI prompt...';
        this.composer.append(placeholder);

        // Placeholer show/hide events
        this.editable.addEventListener('focus', () => {
            if (!this.editable.textContent.trim()) {
                placeholder.style.display = 'none';
            }
        });

        this.editable.addEventListener('blur', () => {
            if (!this.editable.textContent.trim()) {
                placeholder.style.display = 'block';
            }
        });

        this.editable.addEventListener('input', () => {
            this.fit();
            if (this.editable.textContent.trim()) {
                placeholder.style.display = 'none';
            } else {
                placeholder.style.display = 'block';
            }
        });

        // Enter sends the prompt
        this.composer.addEventListener('keydown', event => {
            if (event.key == 'Enter') {
                event.preventDefault();
                const text = this.editable.innerText;
                this.editable.innerText = '';
                this.composerHide();
                this.question(text);
                this.prompt(text);
            }
        });
        this.element.append(this.composer);

        // Typing effect container
        this.typing = document.createElement('div');
        this.typing.classList.add('typing-indicator');
        this.typing.style.display = 'none';

        // Dots
        const dot1 = document.createElement('div');
        dot1.classList.add('dot');
        this.typing.append(dot1);
        const dot2 = document.createElement('div');
        dot2.classList.add('dot');
        this.typing.append(dot2);
        const dot3 = document.createElement('div');
        dot3.classList.add('dot');
        this.typing.append(dot3);

        this.element.append(this.typing);

        // AI Model
        this.model = null;

    }

    /**
     * Start
     */

    start() {
        // Compatibility check and start
        if ('ai' in window) this.composerShow();
        else this.notCompatible();
        this.fit();
    }

    /**
     * Not compatible message
     */

    notCompatible() {
        this.answer('AI is not available in this browser!<br>Please follow these steps to setup <a href="https://github.com/lightning-joyce/chromeai?tab=readme-ov-file#how-to-set-up-built-in-gemini-nano-in-chrome" target="_blank">Gemini Nano @ Chrome Canary</a>.');
    }

    /**
     * Message editor box
     */

    composerShow() {
        this.element.append(this.composer);
        this.composer.style.display = 'block';
    }

    composerHide() {
        this.composer.style.display = 'none';
    }

    /**
     * Show typing effect
     */

    typingShow() {
        this.element.append(this.typing);
        this.typing.style.display = 'flex';
    }

    typingHide() {
        this.typing.style.display = 'none';
    }

    /**
     * Question bubble
     */

    question(text) {
        const bubble = document.createElement('div');
        bubble.classList.add('bubble');
        bubble.classList.add('user');
        bubble.innerHTML += text;
        this.element.append(bubble);
    }

    /**
     * Answer bubble
     */

    answer(text) {
        const bubble = document.createElement('div');
        bubble.classList.add('bubble');
        bubble.classList.add('duck');
        bubble.innerHTML += text;
        this.element.append(bubble);
    }

    /**
     * Send prompt
     */

    async prompt(text) {
        this.typingShow();
        this.fit();
        if (!this.model) {
            try {
                this.model = await window.ai.createTextSession();
            }
            catch(err) {
                this.composerHide();
                this.notCompatible();
            }
        }
        if (this.model) {
            const result = await this.model.prompt(text);
            this.answer(result);
        }
        this.typingHide();
        this.composerShow();
        this.fit();
        this.editable.focus();
    }

    /**
     * Fit the window size to it's content
     */

    fit() {
        this.element.style.top = `-${this.element.offsetHeight - 12}px`;
        this.element.scrollTop = this.element.scrollHeight;
    }

}

global.registry.add({proto: MetavizNodeUberDuck, menu: 'Productivity', name: 'Ãœber Duck', icon: '<span class="mdi mdi-duck"></span>'});
